import React from 'react';
import { Button } from 'react-native';
import { TouchableOpacity, Text } from 'react-native';

function CustomButton({ title, onPress, color, height }) {
  //return <Button color={color} size={size} title={title} onPress={onPress} />;
  return (
  <TouchableOpacity 
    style={{ 
      backgroundColor: color,
      height: height,
      
      }} 
    onPress={onPress}>
  <Text style={{color: 'white',}}>{title}</Text>
</TouchableOpacity>);
}

export default CustomButton;
